script: |
  super -f text -I q292.spq | sort > q292.out

inputs:
  - name: q292.spq
    data: |
      SELECT DISTINCT + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col0 IN ( + col0 * - col1 * - 46 - - - col1, col0, col1 );
  - name: tab1

outputs:
  - name: q292.out
    data: |
      14
      47
      5
